pragma solidity ^0.8.7;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";

contract HealthInsurance is Ownable, ReentrancyGuard {
    // Struct to represent an insurance policy
    struct Policy {
        uint256 id;
        address policyholder;
        uint256 coverageAmount;
        uint256 premium;
        uint256 startDate;
        uint256 endDate;
        bool isActive;
    }

    // Struct to represent a claim
    struct Claim {
        uint256 id;
        uint256 policyId;
        uint256 claimAmount;
        uint256 submissionDate;
        ClaimStatus status;
        string medicalDocuments;
    }

    // Enum for claim status
    enum ClaimStatus {
        Pending,
        Approved,
        Rejected
    }

    // Mappings
    mapping(address => Policy[]) public userPolicies;
    mapping(uint256 => Claim) public claims;
    mapping(address => uint256[]) public userClaims;

    // Policy and Claim Counters
    uint256 public policyCounter;
    uint256 public claimCounter;

    // Insurance plan details
    uint256 public constant MIN_COVERAGE = 10000 * 10**18; // 10,000 USDC
    uint256 public constant MAX_COVERAGE = 1000000 * 10**18; // 1,000,000 USDC
    uint256 public constant MIN_PREMIUM_PERCENTAGE = 5; // 5%
    uint256 public constant MAX_PREMIUM_PERCENTAGE = 20; // 20%

    // Events
    event PolicyPurchased(
        address indexed policyholder, 
        uint256 indexed policyId, 
        uint256 coverageAmount, 
        uint256 premium
    );
    event ClaimSubmitted(
        address indexed policyholder, 
        uint256 indexed claimId, 
        uint256 claimAmount
    );
    event ClaimProcessed(
        uint256 indexed claimId, 
        ClaimStatus status
    );

    // Purchase a new health insurance policy
    function purchasePolicy(uint256 coverageAmount) external payable nonReentrant {
        // Validate coverage amount
        require(
            coverageAmount >= MIN_COVERAGE && 
            coverageAmount <= MAX_COVERAGE, 
            "Invalid coverage amount"
        );

        // Calculate premium (simplified calculation)
        uint256 premium = calculatePremium(coverageAmount);
        require(msg.value >= premium, "Insufficient premium payment");

        // Create new policy
        Policy memory newPolicy = Policy({
            id: policyCounter,
            policyholder: msg.sender,
            coverageAmount: coverageAmount,
            premium: premium,
            startDate: block.timestamp,
            endDate: block.timestamp + 365 days, // 1 year policy
            isActive: true
        });

        // Store policy
        userPolicies[msg.sender].push(newPolicy);
        policyCounter++;

        // Emit event
        emit PolicyPurchased(msg.sender, newPolicy.id, coverageAmount, premium);

        // Refund excess payment
        if (msg.value > premium) {
            payable(msg.sender).transfer(msg.value - premium);
        }
    }

    // Submit a claim
    function submitClaim(
        uint256 policyId, 
        uint256 claimAmount, 
        string memory medicalDocuments
    ) external nonReentrant {
        // Find the policy
        Policy storage policy = _findUserPolicy(policyId);

        // Validate claim
        require(policy.isActive, "Policy is not active");
        require(
            claimAmount <= policy.coverageAmount, 
            "Claim amount exceeds coverage"
        );

        // Create claim
        Claim memory newClaim = Claim({
            id: claimCounter,
            policyId: policyId,
            claimAmount: claimAmount,
            submissionDate: block.timestamp,
            status: ClaimStatus.Pending,
            medicalDocuments: medicalDocuments
        });

        // Store claim
        claims[claimCounter] = newClaim;
        userClaims[msg.sender].push(claimCounter);
        claimCounter++;

        // Emit event
        emit ClaimSubmitted(msg.sender, newClaim.id, claimAmount);
    }

    // Process a claim (only by owner/admin)
    function processClaim(
        uint256 claimId, 
        bool approve
    ) external onlyOwner nonReentrant {
        Claim storage claim = claims[claimId];
        Policy storage policy = _findUserPolicy(claim.policyId);

        require(claim.status == ClaimStatus.Pending, "Claim already processed");

        if (approve) {
            claim.status = ClaimStatus.Approved;
            // Transfer claim amount to policyholder
            payable(policy.policyholder).transfer(claim.claimAmount);
        } else {
            claim.status = ClaimStatus.Rejected;
        }

        // Emit event
        emit ClaimProcessed(claimId, claim.status);
    }

    // Internal function to find user's policy
    function _findUserPolicy(
        uint256 policyId
    ) internal view returns (Policy storage) {
        Policy[] storage policies = userPolicies[msg.sender];
        for (uint256 i = 0; i < policies.length; i++) {
            if (policies[i].id == policyId) {
                return policies[i];
            }
        }
        revert("Policy not found");
    }

    // Calculate premium based on coverage amount
    function calculatePremium(
        uint256 coverageAmount
    ) internal pure returns (uint256) {
        // Simplified premium calculation
        // Premium is between 5-20% of coverage amount
        uint256 premiumPercentage = MIN_PREMIUM_PERCENTAGE + 
            ((coverageAmount * (MAX_PREMIUM_PERCENTAGE - MIN_PREMIUM_PERCENTAGE)) / MAX_COVERAGE);

        return (coverageAmount * premiumPercentage) / 100;
    }

    // Withdraw contract balance (only owner)
    function withdraw() external onlyOwner {
        payable(owner()).transfer(address(this).balance);
    }

    // Fallback and receive functions
    receive() external payable {}
    fallback() external payable {}
}","keccak256":"0xafead4f96dabbd4f9b6385f19ee0021a860d670dcf7c7ce9d0a89718f94ef276","license":"MIT"}},"version":1}
